import './Enter.css'

function Enter()    {    

    return (
        <>
            <form onSubmit={(e) => {e.preventDefault();}}>
                <div className='container'>
                    <div className="input">
                        <div className='submit'>
                            <button type="submit" >Submit</button>
                        </div>
                        <img src="" alt="" />
                        <label htmlFor="input">enter code</label>
                        <input className = "input" type = "password" onChange = '' placeholder = 'fi$pond' />
                    </div>
                </div>
            </form>
        </>
    );
}

export default Enter;
